import styled from "styled-components";
import './FAQ.css'

const Container = styled("div")`
    width: 100%;
    background-color: white;
    margin:auto;
    margin-top:100px;
    padding: 20px;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
`

const FAQ =() =>{
    return (
        <Container id="FAQ">

        </Container>
    )
}

export default FAQ;
